Other deductions - action code: Enter the code  that best describes the greatest deduction amount. The deduction codes are:
A - Deductible balancing adjustment;
B - Contribution that is a fringe benefit;
C - Exclusion of personal contributions;
E - Environment protection expenditure
I - Listed investment company capital gain amount;
N - Deduction relating toforeign non-assessable non-exempt income;
O - Other deductions not listed above;
R - Return of contributions by non-complying funds;
S - Superannuation (Financial Assistance Funding) Levy Act 1993; and
T - TOFA losses or TOFA balancing adjustment.

Other income - action code: Enter the code that best describes the greatest amount included at Other income. The codes for other income are:
B - Assessable balancing adjustment amount;
C - LIC capital gains amount;
R - Rebate or refund of death or disability premiums;
T - TOFA gains or TOFA balancing adjustment income;
W - Gross payments subject to foreign resident withholding; and
O - Other income received not listed above.

Type of fund or trust: Select the code that best describes the type of fund or trust at balance date. Do not select more than one.  The codes for these fields are:
'022' - Small APRA Fund; 
'198' - Retail Fund; 
'118' - Industry Fund;
'053' - Corporate Fund; 
'085' - Eligible Rollover Fund;
'009' - Approved Deposit Fund;
'168' - Pooled Superannuation Trust;
'010' - Public sector fund; and 
'138' - Non-Regulated Fund.  
This is a mandatory field.
